import styled from "styled-components";

export const StyledContainerSocial = styled.div`
    .title {
        font-style: normal;
        font-weight: bold;
        font-size: 20px;
        line-height: 27px;
        color: #000000;
        max-width: 70%;
        margin: 0 auto 46px auto;
    }
`;
